import Link from 'next/link';

const linkStyle = {
}

const Header = () => (
	<div>
		<Link href="/">
			<a style={linkStyle}>Home</a>
		</Link>
		<Link href="/about">
			<a style={linkStyle}>About</a>
		</Link>
		<Link href="/login">
			<a style={linkStyle}>Login</a>
		</Link>
	</div>
);

export default Header;
